import React from 'react';

function Navbar(){
	return (
		<nav class="menu">
		<ul>
		  <li><a href="#">Home</a></li>
		  <li><a href="#">News</a></li>
		  <li><a href="#">Destination</a></li>
		  <li><a href="#">Blog</a></li>
		  <li><a href="#">Contact</a></li>
		</ul>
	  </nav>
	)
}


export default Navbar;
